// src/components/Dashboard.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Dashboard.css';
import { HomeOutlined, DashboardOutlined, CalendarOutlined, UserOutlined } from '@ant-design/icons';
import fitnes1 from '../images/fitnes1.img';
import fitnes2 from '../images/fitnes2.img';
import fitnes11 from '../images/fitnes11.img';

const Dashboard = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  return (
    <div className="dashboard-container">
      <div className="tab-bar">
        <div
          className={`hamburger-icon ${isSidebarOpen ? 'active' : ''}`}
          onClick={toggleSidebar}
        >
          &#9776;
        </div>
        <Link to="/profile" className="profile-icon">
          <UserOutlined />
        </Link>
      </div>
      <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
        <ul>
          <li><HomeOutlined /> Home</li>
          <li><DashboardOutlined /> Dashboard</li>
          <li><CalendarOutlined /> Calendar</li>
          <li><UserOutlined /> Profile</li>
        </ul>
      </div>
      <div className="dashboard-grid">
        <Link to="/fitnes1" className="grid-item fitnes1">
          <div className="overlay">首の可動性</div>
        </Link>
        <Link to="/fitnes2" className="grid-item fitnes2">
          <div className="overlay">肩の可動性</div>
        </Link>
        <div className="grid-item">首の回旋可動性</div>
        <div className="grid-item">胸椎の可動性</div>
        <div className="grid-item">上体の屈力</div>
        <div className="grid-item">前腕の可動性</div>
        <div className="grid-item">前腕の可動性</div>
        <div className="grid-item">前腕の可動性</div>
        <div className="grid-item">体幹の屈力</div>
        <div className="grid-item">下半身の筋力</div>
        <Link to="/fitnes11" className="grid-item fitnes11">
          <div className="overlay">足首の柔らかさ</div>
        </Link>
      </div>
    </div>
  );
};

export default Dashboard;
